-- data cleaning
UPDATE hr_analytics_dataset_adviti
SET Gender = REPLACE(REPLACE(Gender, 'M', 'Male'), 'Maleale', 'Male');
UPDATE hr_analytics_dataset_adviti
SET Gender = REPLACE(REPLACE(Gender, 'F', 'Female'), 'Femaleemale', 'Female');

UPDATE hr_analytics_dataset_adviti
SET Position = 
    CASE 
        WHEN Position IN ('Account Executive', 'Account Exec.', 'AccountExec.','AccountExecutive') THEN 'Account Executive'
        WHEN Position IN ('Data Analyst', 'DataAnalyst') THEN 'Data Analyst'
        WHEN Position IN ('Content Creator', 'Creator') THEN 'Content Creator'
        WHEN Position = 'CEO' THEN 'Chief Executive Officer'
        WHEN Position = 'COO' THEN 'Chief Operating Officer'
        WHEN Position = 'CTO' THEN 'Chief Technology Officer'
        ELSE Position 
    END;
    

-- descriptive Statistics
SELECT AVG(Age) AS AverageAge, MIN(Salary) AS MinSalary, MAX(Salary) AS MaxSalary
from hr_analytics_dataset_adviti;

SELECT Department, round(AVG(Salary),2) AS AverageSalary
from hr_analytics_dataset_adviti
GROUP BY Department;

select avg(performance_rating),avg(work_hours) from hr_analytics_dataset_adviti
where attrition='yes';

SELECT Department, AVG(Satisfaction_Score) AS AvgSatisfaction
from hr_analytics_dataset_adviti
WHERE Attrition = 'Yes'
GROUP BY Department
ORDER BY AvgSatisfaction DESC;

SELECT AVG(Performance_Rating) AS AvgPerformance, AVG(Training_Hours) AS AvgTrainingHours
from hr_analytics_dataset_adviti;
    
