 education_level,
  AVG(Training_Hours) AS Avg_Training_Hours,
    count(CASE WHEN JobSatisfaction_PeerRelationship = 1 THEN 1 END)as PeerRelationship,
    count(CASE WHEN JobSatisfaction_WorkLifeBalance = 1 THEN 1 END) as WorkLifeBalance,
    count(CASE WHEN JobSatisfaction_Compensation = 1 THEN 1 END)as Compensation,
    count(CASE WHEN JobSatisfaction_Management = 1 THEN 1 END) as Management,
    count(CASE WHEN JobSatisfaction_JobSecurity = 1 THEN 1 END)as JobSecurity
    from hr_analytics_dataset_adviti
    group by education_level;
    
    SELECT
    AVG(Training_Hours) AS Avg_Training_Hours,
    COUNT(CASE WHEN Attrition = 'Yes' THEN 1 END) AS AttritionCount
FROM hr_analytics_dataset_adviti;
